CREATE TABLE `isb-cgc-bq.pancancer_atlas.Whitelist_ParticipantBarcodes`
(
  ParticipantBarcode STRING OPTIONS(description="TCGA barcode identifier for the study participant, eg TCGA-02-0001")
)
OPTIONS(
  friendly_name="Pancancer Participants Whitelist",
  description="Extracted from PanCancer Atlas initiative on the GDC in Aug 2016. Contains participant barcodes used in by the PanCancer Atlas initiative.  \n\nMore details: https://gdc.cancer.gov/about-data/publications/pancanatlas",
  labels=[("category", "clinical_biospecimen_data"), ("status", "current"), ("access", "open"), ("source_0", "gdc"), ("data_type", "biospecimen_supplement"), ("program", "pancancer_atlas"), ("reference_genome", "hg19"), ("source_1", "literature")]
);
